import React from 'react';
import './header.css'
import people from '../../assets/people.png'

const Header = () => {
    return (
        <div className='gpt3__header section__padding'>
            <div className='gpt3__header-content'>
                <h1 className='gradient__text'>
                    Let's build something amazing with Open AI
                </h1>
                <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nihil aliquid magnam dolores numquam architecto similique suscipit voluptatibus quibusdam molestias veniam? Fugiat quisquam eaque sequi nam recusandae saepe consequatur porro repellendus!</p>
                <div className='gpt3__header-content_input'>
                    <input type="email" placeholder='Ex: lisa@gmail.com' />
                    <button type="button">Get started</button>
                </div>
                <div className='gpt3__header-content-image'>
                    <img src={people} alt="people" />
                </div>
            </div>

        </div>
    );
};

export default Header;
